【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 先代モデルからカメラ機能を大幅強化<br />ZC551KLは従来モデルと比べて3倍の距離を補足できる、第二世代のレーザーオートフォーカス。<br />写真の色合いを自動調整する色彩補正センサ。SONY製のIMX214センサ搭載など、先代モデルのZenFone2Laser(ZE500KL)と比べて、カメラ機能が大幅に強化されました。<br /><br />★ au VoLTEに対応<br />ZC551KLは、LTEによる高音質通話サービスの「au VoLTE」をサポートしています。<br />これによりZC551KLは、日本の大手キャリアすべての通話をサポートしている、マルチキャリア対応の端末になります。<br /><br />★ 高級感のあるデザイン<br />ZC551KLの本体は、メタルボディを採用。さらにパネル側も2.5D曲面ガラスを採用しており、非常に高級感のあるデザインになっています。<br /><br />★ フルHD液晶パネルを搭載<br />ZC551KLは、フルHD液晶パネルを搭載しています。これにより、写真や画像などの元素材を劣化させることなく、高精細な映像を劣化することなく表示することができます。<br /><br />★ 大容量メインメモリを搭載<br />ZC551KLは、大容量の4GBメインメモリを搭載しています。これにより、マルチタスクの作業なども快適に行う事ができます。<br /><br />★ 指紋認証機能を搭載<br />ZC551KLは、本体背面に指紋センサを搭載しています。指紋を登録することにより、従来よりも素早く端末のロック解除が可能になります。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* プラットフォーム：Android 6.0.1<br />* プロセッサー名：Qualcomm Snapdragon 430 (オクタコアCPU)<br />* 動作周波数：1.4GHz<br />* メインメモリ：4GB<br />* メインメモリ仕様：LPDDR3<br />* ディスプレイ：5.5型ワイド TFTカラータッチスクリーン IPS液晶 (LEDバックライト)Corning Gorilla Glass 3<br />* 解像度：1920×1080ドット (フルHD)<br />* グラフィックス機能：Adreno 505 <br />* 内蔵ストレージ：32GB</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
